var inputs = workflow.inputs;

var api = new x_neyu_modtrak.ModTrakAPI();
var response = api.create(
    inputs.u_requestor,
    inputs.u_application_name,
    inputs.u_application_function,
    inputs.u_subject,
    inputs.u_status,
    inputs.u_description,
    inputs.u_reason_for_change,
    inputs.u_change_type,
    inputs.u_priority,
    inputs.u_ref_number,
    inputs.u_request_date,
    inputs.u_requested_due_date,
    inputs.u_department,
    inputs.u_workflow_flag,
    inputs.u_dept_approver,
    inputs.u_dept_appr_date,
    inputs.u_work_started_date,
    inputs.u_complete_date,
    inputs.u_info_tech_approver,
    inputs.u_info_tech_appr_date
);

workflow.info("response: " + JSON.stringify(response));

if (response.error) {
    workflow.error(response.errorMessage);
    activity.result = "error";
} else {
    workflow.scratchpad.modtrak_number = "test1234";
    activity.result = "success";
}

